export default function reducer(preState, action) {
  console.log(preState);
  const { type, data } = action
  switch (type) {
    case '+':
      return preState + data
    case '-':
      return preState - data
    case 'x':
      return preState * data
    case '/':
      return preState / data
    default:
      return 0;
  }
}
